    ];
    string[] floki = [
        "ipfs://QmbF534aUPpQAuQL5C7pS53TqppZFHJ22WQRZBdypb2gqd/Floki-01.png",
        "ipfs://QmbF534aUPpQAuQL5C7pS53TqppZFHJ22WQRZBdypb2gqd/Floki-02.png",
